define({"topics" : [{"title":"Case Study: Write Avro Pipeline","shortdesc":"\n                  <p class=\"shortdesc\">The Write Avro pipeline can be pretty simple - it just needs to write large Avro         files. You can make it complicated\n                     by performing additional processing, but at its most         basic, all you need is an origin and an Avro-enabled file-based\n                     destination to write the         Avro files.\n                  </p>\n               ","href":"datacollector\/UserGuide\/Processors\/WholeFileTransformer.html#concept_nf1_5zg_n2b","attributes": {"data-id":"concept_nf1_5zg_n2b",},"menu": {"hasChildren":false,},"tocID":"concept_nf1_5zg_n2b-d46e76953","topics":[]},{"title":"Case Study: Parquet Conversion Pipeline","shortdesc":"\n                  <p class=\"shortdesc\">The Parquet Conversion pipeline is simple as well. It uses the <a class=\"xref\" href=\"datacollector\/UserGuide\/Data_Formats\/WholeFile.html#concept_nfc_qkh_xw\">whole file</a> data format,         so no processing of file data can occur except the conversion of the Avro files to Parquet. \n                  </p>\n               ","href":"datacollector\/UserGuide\/Processors\/WholeFileTransformer.html#concept_thp_c2h_n2b","attributes": {"data-id":"concept_thp_c2h_n2b",},"menu": {"hasChildren":false,},"tocID":"concept_thp_c2h_n2b-d46e77039","topics":[]},{"title":"Case Study: Runtime","shortdesc":"\n                  <p class=\"shortdesc\">We start both pipelines at the same time. </p>\n               ","href":"datacollector\/UserGuide\/Processors\/WholeFileTransformer.html#concept_lvy_gf3_n2b","attributes": {"data-id":"concept_lvy_gf3_n2b",},"menu": {"hasChildren":false,},"tocID":"concept_lvy_gf3_n2b-d46e77138","topics":[]}]});